							setupvalue(v,i2,0)
						until not _G.GeppoNoCd
					end
				end
			end
			if getfenv(v).script == game.Players.LocalPlayer.Character:WaitForChild("Soru") and _G.SoruNoCd then
				for i2,v2 in pairs(debug.getupvalues(v)) do
