                newTextLabel.Text = text
                newTextLabel.BackgroundTransparency = 1
                newTextLabel.TextColor3 = Color3.new(1, 0, 0)
                newTextLabel.Size = UDim2.new(0, 200, 0, 20)
                newTextLabel.Position = UDim2.new(0.5, -100, positionY, -10)
